  const infos = data.info.company;
  return (
    <div className="about">
      <h3>About us</h3>
      <h4>会社概要</h4>
      <ul>
        {infos.map(info => (
          <li>{info.title}</li>
        ))}
      </ul>
    </div>
  );
};
